import React from 'react'
import logo from '../../img/paugur.svg'
import {
    Floating
} from './logo.styles'

const Logo = () => {
    return (
        <Floating>
            <img src={logo} className="logo" alt="Paugur" />
        </Floating>
    )
}

export default Logo;
